import React from 'react';
import { NavLink } from 'react-router-dom';

import LinkItem from '../components/LinkItem/LinkItem'

import styles from './DefaultPage.module.css'

export default ( {match} ) => {
  const departmentId = match.params.departmentId
  const schedule = JSON.parse(localStorage.getItem('schedule'));
  const doctors = schedule['departments'][departmentId]['doctors']

  return (
    <div className={styles.page}>
      <ul className={styles.list}>
        {Object.keys(doctors).map(id =>
          <NavLink to={`doctor/${id}/schedule`} >
            <LinkItem
              key={id}
              index={id}
              text={doctors[id]['lastName'] + ' ' + doctors[id]['firstName'] + ' ' + doctors[id]['secondName']} />
        </NavLink>)}
      </ul>
    </div>
  );
};
